import { useState } from 'react'
import ResultElem from "../components/resultelem"
function TabellineLog() {

    const [results, setResults]=useState([1,2,3])
    const handleSubmit=(event)=>{
        event.preventDefault()
        alert('hey')
    } 
    const displayLog = ()=>{
        return(
            results.map((r)=>(<ResultElem text={r}/>))
        )
    }   
    return (<div><h1>TABELLINE</h1>
     <form onSubmit={handleSubmit}>
                    <input type="text"/>
                    <button>ok</button>
    </form>
    <div className="tabelline-log">
        xx{displayLog()}
    </div>

    </div>)
}


export default TabellineLog
